script: |
  super -f text -I q7333.spq | sort > q7333.out

inputs:
  - name: q7333.spq
    data: |
      SELECT ALL + col0 + 97 FROM tab1 (FORMAT parquet) AS cor0 WHERE 23 NOT BETWEEN + + col0 * col2 AND - col1 - + 26 + + + 41 + - col0 * - + col2 * - col0 OR + CAST ( + col0 AS REAL ) + + + col0 <= - + col1 + CAST ( NULL AS REAL ) / + - ( col1 );
  - name: tab1

outputs:
  - name: q7333.out
    data: |
      148
      182
      188
